        let damage_after_resistances = get_attack_damage_to_tile(attack_type, dmg as u16, self.class);
        let mut c = self;
        if damage_after_resistances > (c.health as u16) {
            c.health = 0;
        } else {
            c.health -= (damage_after_resistances as u8);
        }
        c
    }

