pub fn get_trap_damage_to_tile(damage: u16, class: u8) -> u16 {
    debug!(quote { assert(class <= arenalib::MAX_DAMAGEABLE_TILE); });
    (damage * trap_resistances[class & 7] / 100) as u16
}

