pub fn turn(
    // verification_key: pub [Field; 114],
    // proof: pub [Field; 93],
    // public_inputs: pub [Field; 1 ],//+ 2 * SERIALIZED_ENEMY_OBSTACLES_ARRAY_SIZE + 2 * SERIALIZED_EVENTS_ARRAY_SIZE],
    // key_hash: pub Field,
    // last_move: pub u32,
